As regulated by the Chinese labour law:All employees shall be paid higher than the normal hourly rates as below:

(For the standard working hours system)

1. No less than 150% of the regular rates when extending the working time;

2. No less than 200% of the regular rates for the overtime work on rest days without compensatory time; 

3. No less than 300% of the regular rates for the public holiday overtime hours.
